        <style>
            @-webkit-keyframes pulse {
                0% {
                    opacity: 1;
                }
                16.666% {
                    opacity: 1;
                }
                100% {
                    opacity: 0;
                }
            }
            @-moz-keyframes pulse {
                0% {
                    opacity: 1;
                }
                16.666% {
                    opacity: 1;
                }
                100% {
                    opacity: 0;
                }
            }
            @keyframes pulse {
                0% {
                    opacity: 1;
                }
                16.666% {
                    opacity: 1;
                }
                100% {
                    opacity: 0;
                }
            }
            .triangles {
                -webkit-transform: translate(-50%, -50%);
                -moz-transform: translate(-50%, -50%);
                -ms-transform: translate(-50%, -50%);
                transform: translate(-50%, -50%);
                height: 81px;
                width: 90px;
                position: absolute;
                left: 50%;
                top: 50%;
            }
            .tri {
                position: absolute;
                -webkit-animation: pulse 750ms ease-in infinite;
                -moz-animation: pulse 750ms ease-in infinite;
                animation: pulse 750ms ease-in infinite;
                border-top: 27px solid #008AAD;
                border-left: 15px solid transparent;
                border-right: 15px solid transparent;
                border-bottom: 0px;
            }
            .tri.invert {
                border-top: 0px;
                border-bottom: 27px solid #008AAD;
                border-left: 15px solid transparent;
                border-right: 15px solid transparent;
            }
            .tri:nth-child(1) {
                left: 30px;
            }
            .tri:nth-child(2) {
                left: 15px;
                top: 27px;
                -webkit-animation-delay: -125ms;
                -moz-animation-delay: -125ms;
                animation-delay: -125ms;
            }
            .tri:nth-child(3) {
                left: 30px;
                top: 27px;
            }
            .tri:nth-child(4) {
                left: 45px;
                top: 27px;
                -webkit-animation-delay: -625ms;
                -moz-animation-delay: -625ms;
                animation-delay: -625ms;
            }
            .tri:nth-child(5) {
                top: 54px;
                -webkit-animation-delay: -250ms;
                -moz-animation-delay: -250ms;
                animation-delay: -250ms;
            }
            .tri:nth-child(6) {
                top: 54px;
                left: 15px;
                -webkit-animation-delay: -250ms;
                -moz-animation-delay: -250ms;
                animation-delay: -250ms;
            }
            .tri:nth-child(7) {
                top: 54px;
                left: 30px;
                -webkit-animation-delay: -375ms;
                -moz-animation-delay: -375ms;
                animation-delay: -375ms;
            }
            .tri:nth-child(8) {
                top: 54px;
                left: 45px;
                -webkit-animation-delay: -500ms;
                -moz-animation-delay: -500ms;
                animation-delay: -500ms;
            }
            .tri:nth-child(9) {
                top: 54px;
                left: 60px;
                -webkit-animation-delay: -500ms;
                -moz-animation-delay: -500ms;
                animation-delay: -500ms;
            }
			body.modal-open .container-fluid {
				position: unset !important;
			}
        </style>
